import { Route, Routes } from 'react-router-dom';
import './App.css';
import Details from './react-projects-junaid/Classes/Details';
// import Students from './components/Students';
import Main from './react-projects-junaid/Classes/Main';

function App() {
  return (
    <div className="App">
      {/* <Students/> */}
      <Main/>       
      <Routes>
        <Route path='/' element={<Details/>}/>
      </Routes>
    </div>
  );
}

export default App;
